import React from 'react';
import ReactDOM from 'react-dom';
import a from './img_profile.js';



class MyView extends React.Component {

	render() {
		return (
			<div>
				<a />
			</div>
		);
	}
}


// ========================================

ReactDOM.render(
	<MyView/>,
	document.getElementById('root'),	
);
